import Home from '../data/home.json';

const Render = () => {

    var Link = 'https://www.snapchat.com/invite/M2I4MDAxMTgtMjFiMy00ZmU5LWFhZDgtMmJjNGNiM2RmOTZl/NzUyZDA1MTctZjkzMS00NTRhLWEwNTUtM2ZiMmM5Y2E1ZmI1'

    return (
        <div>
            <div className='flex flex-col space-y-4 text-lg p-8'>
                <div className='text-4xl font-bold leading-normal'>{Home.T1}</div>
                <div>{Home.P1}</div>
                <a href={Link} className='bg-black text-white text-center rounded my-5 w-max p-2.5 px-4'>Join the trading groupchat!</a>
                <img src={require('../images/meme.jpg').default} className=''/>
                <div>{Home.P2}</div>
                <div>{Home.H1}</div>
            </div>
        </div>
    )
}

export default Render

